import React from 'react';
import './App.css';
import Main1 from './Components/main';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component{
  constructor(){
    super()
    this.state={
      value:'black'
    }
  }
  changecolortowhite = ()=>{
    this.state.value='white'
  }
  changecolortoblack = ()=>{
    this.state.value='white'
  }

  render(){
    return(
      <div>
        <Main1 towhite={this.changecolortowhite} toblack={this.changecolortoblack} value1={this.state.value}/>
      </div>
    )
  }
}

export default App;
